import React from "react";
import styled from "styled-components";
import MeTube from "../img/me-logo.png";

const Container = styled.div`
  flex: 1;
  background-color: #004284;
  height: 100vh;
  color: white;
  font-size: 27px;
`;

const Wrapper = styled.div`
  padding: 18px 26px;
`;

const Logo = styled.div`
  display: flex;
  align-items: center;
  gap: 5px;
  font-weight: 800;
  margin-bottom: 25px;
`;

const Img = styled.img`
  height: 75px;
`;

const Item = styled.div`
  display: flex;
`;

const Menu = () => {
    return(
        <Container>
            <Wrapper>
                <Logo>
                    <Img src={MeTube} />
                    T u b e
                </Logo>
            </Wrapper>
        </Container>
    );
};

export default Menu;
